import React, { useState, useEffect } from "react";
// import "./Styles.css";

function Contact() {
  useEffect(() => {
    fetching();
  }, []);
  const [datas, setData] = useState({
    basemap: [],
  });

  const fetching = () => {
    var url = new URL(
      "https://maps.geoapify.com/v1/styles/osm-carto/style.json?apiKey=c9d537a678bb427e998a64fddaebf3aa"
    );

    var params = [
      ["lat", "47.68388118858141"],
      ["lon", "8.614278188654232"],
      ["mode", "drive"],
      ["type", "time"],
      ["range", "2700"],
      ["api_key", "c9d537a678bb427e998a64fddaebf3aa"],
    ];
    url.search = new URLSearchParams(params);

    fetch(url)
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setData(data);
      })
      .catch((err) => console.log(err));
  };

  return (
    <div className="centered">
      <h2>Contact and Map</h2>
      <iframe className="mapContent" src={datas.sourses[0].url}></iframe>
    </div>
  );
}

export default Contact;
